import{_ as t,c as a,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const T=JSON.parse('{"title":"DROP TEXT SEARCH TEMPLATE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_TEMPLATE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_TEMPLATE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_TEMPLATE.md"};function n(r,e,l,d,c,p){return s(),a("div",null,e[0]||(e[0]=[o('<h1 id="drop-text-search-template" tabindex="-1">DROP TEXT SEARCH TEMPLATE <a class="header-anchor" href="#drop-text-search-template" aria-label="Permalink to &quot;DROP TEXT SEARCH TEMPLATE&quot;">​</a></h1><h2 id="description" tabindex="-1"><a id="Description"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;Description&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>Removes a text search template.</p><h2 id="synopsis" tabindex="-1"><a id="Synopsis"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;Synopsis&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH TEMPLATE [ IF EXISTS ] &lt;name&gt; [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description-1" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description-1" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TEXT SEARCH TEMPLATE</code> drops an existing text search template. You must be a superuser to use this command.</p><p>You must be a superuser to use <code>ALTER TEXT SEARCH TEMPLATE</code>.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the text search template does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of an existing text search template.</p><p>CASCADE : Automatically drop objects that depend on the text search template, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the text search template if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the text search template <code>thesaurus</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH TEMPLATE thesaurus;</span></span></code></pre></div><p>This command will not succeed if there are any existing text search dictionaries that use the template. Add <code>CASCADE</code> to drop such dictionaries along with the template.</p><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>DROP TEXT SEARCH TEMPLATE</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TEXT_SEARCH_TEMPLATE.html">ALTER TEXT SEARCH TEMPLATE</a>, <a href="./CREATE_TEXT_SEARCH_TEMPLATE.html">CREATE TEXT SEARCH TEMPLATE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',22)]))}const E=t(i,[["render",n]]);export{T as __pageData,E as default};
